import React, {useState} from 'react';
import logo from './logo.svg';
import './App.css';
import {Login} from './Login';
import { Register } from './Register';
import {Navigation} from './Navigation';
import {Cover} from './Cover';
function App() {
  const [currentForm, setCurrentForm]=useState('Cover');

  const toggleForm =(formName) => {
    setCurrentForm(formName);
  }
  return (
    <div className="App">
      {
        currentForm==="Cover"?<Cover onFormSwitch={toggleForm} />:currentForm=== "login"?<Login onFormSwitch={toggleForm}/>:currentForm=== "register"?<Register onFormSwitch={toggleForm} />:<Cover onFormSwitch={toggleForm} />
      }
    </div>
  );
}

export default App;
